INSERT INTO `recipe` VALUES (1,'Erdbeere auf Erdbeere','Hier ein Bild',2,'Eine Erdbeere oben auf einer Erdbeere','Einfach die Erdbeere auf die andere Erdbeere legen','2020-05-08 00:00:00',2,'Extrem',1,NULL,2),(2,'gebuttertes Toast','images/recipesByUserId/2/meinToast.jpg',4,'hole das Maximum aus deinem Toast hinaus und mach es wieder fresh!','Toasten, Butter draufschmieren, fertig, zubeissen.','2020-05-10 03:46:51',5,'easy',0,NULL,2),(3,'Pfannkuchen','images/recipiesByUserId/3/pfannKuchen.jpg',2,'leckere Pfannkuchen mit Apfelstückchen','die Eier mit dem Zucker cremig aufschlagen. Währenddessen kann man Äpfel klein würfeln. Als nächstes alle Zutaten nacheinander dazugeben und zu einem glatten Teig mit Hilfe eines Schneebesens zu einem glatten Teig rühren. Damit der Teig nicht an der Pfanne kleben bleibt, gebt noch bisschen Öl dazu. Danach den Teig für ca.15 Minuten ruhen lassen, da das Mehl noch ausquillt. Danach eine große Schöpfkelle Teig in eine auf mittlere Hitze erhitzte, am besten beschichtete Pfanne geben. Wenn sich kleine Bläschen bilden kann der Pfannkuchen gewendet werden und von der anderen Seite goldbraun ausgebacken werden.','2020-05-10 14:33:02',15,'easy',0,NULL,6),(4,'Granola','images/recipesByUserId/3/granola.jpg',6,'Müsli aus dem Ofen','Zuerst die Nüsse klein kloppen, dann die eingelegten Pflaumen in kleine Stücke hacken. Anschließend Haferflocken mit den Nüssen, Pflaumen, Honig und Zimt vermischen. Den Ofen auf 180 Grad vorheizen und ein Backblech mit Backpapier auslegen. Darauf die Granola-Masse verteilen und ab in den Ofen für 15-25 Minuten. Die Backzeit kann stark variieren, also aufpassen. Schließlich die Granola aus dem Backofen holen und auskühlen lassen, danach gerne mit Rosinen und anderen Trockenfrüchten vermischen, je nach Geschmack.','2020-05-10 21:05:13',30,'easy',1,NULL,3),(5,'Sommereis','images/recipesByUserId/15/meinToast.png',2,'Vanilleeis mit Erdbeeren','Man neme Vanilleeis und lege Erdbeeren drauf','2020-05-29 11:51:10',2,'easy',0,NULL,15),(6,'Joghurt','images/recipeByUserID/15/joghurt.png',1,'Leckerer Joghurt - selbstgemacht','Naturjoghurt mit Erdbeeren verrühren','2020-05-29 13:19:38',3,'easy',0,NULL,15),(19,'Changetest Title','images/myId/aaa/kuchenTest.png',3,'Test Discription','Einmal testen','2020-06-20 15:36:02',60,'easy',0,'2020-06-21 08:59:02',15);
